import React from 'react'
import Topbar from "./component/topbar/Topbar";
import Home from "./pages/home/Home";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import Settings from "./pages/settings/Settings";
import Single from "./pages/single/Single";
import Write from "./pages/write/Write";
import { BrowserRouter as Router, Routes, Route,Navigate  } from "react-router-dom";

function App() {
  const currentUser = true;
  return (
    <Router>

      <Topbar />
      <Routes>
        <Route path=" " element={<Home />} />
        <Route path="posts" element={<Home />} />
        <Route  path="register" element = {currentUser ? ( <Home />) : (<Navigate replace to= {"Register"} /> ) } />
        <Route  path="login" element = {currentUser ? ( <Home />) : (<Navigate replace to= {"Login"} /> ) } />
        <Route path=" post/:id" element={<Single />} />
        <Route  path="write" element = {currentUser ? ( <Write />) : (<Navigate replace to= {"Login"} /> ) } />
        <Route path="settings" element = {currentUser ? ( <Settings />) : (<Navigate replace to= {"Login"} /> ) } />

      </Routes>
    </Router>
  );
}

export default App;
